import React from 'react';
import { Jumbotron } from 'reactstrap';

const Homepage = () => {
  return (
    <div>
      <Jumbotron color="light">
        <h1 className="display-3">Jobly</h1>
        <p className="lead">Your go-to place for the newest jobs.</p>
        <hr className="my-2" />
        <p>Welcome back!</p>
      </Jumbotron>
    </div>
  )
};

export default Homepage;
